import { BrowserRouter } from "react-router-dom";
import Product from "./Product";
import AddItem from "./AddItem";

function App() {

  return (
    <>
    <BrowserRouter>
      <Route path="/" element={<Product />}></Route>
      <Route path="/additem" element={<AddItem />}></Route>
    </BrowserRouter>
    </>
  );
}

export default App;
